/**
 * High level router.
 *
 * Note: It's recommended to compose related routes in internal router
 * components (e.g: `src/pages/auth/AuthPage`, `src/pages/home/HomePage`).
 */

import React, { Suspense, useState } from 'react';
import { Route, Switch, Redirect } from 'react-router-dom';
import { Grid } from '@material-ui/core';
import Hero from './components/Hero';
import Features from './components/Features';
import LoadingIndicator from 'app/views/components/common/LoadingIndicator';
const FeaturedTests = React.lazy(() => import('./components/FeaturedTests'));

export default function LandingPage(props) {
	return (
		<React.Fragment>
			<Hero></Hero>
			<Features></Features>
			<React.Suspense fallback={<LoadingIndicator hasSpacing />}>
				<FeaturedTests></FeaturedTests>
			</React.Suspense>
		</React.Fragment>
	);
}
